script: |
  super -f text -I q3333.spq | sort > q3333.out

inputs:
  - name: q3333.spq
    data: |
      SELECT - col2 + - 23 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 NOT BETWEEN col0 - col0 AND - 0 * + + ( - 16 );
  - name: tab0

outputs:
  - name: q3333.out
    data: |
      -122
      -33
      -70
